/*Table structure for table `customer_info` */

DROP TABLE IF EXISTS `customer_info`;

CREATE TABLE `customer_info` (
  `CUSTOMER_ID` int(10) NOT NULL COMMENT '客户编号',
  `AFTER_WORK_TIME` datetime DEFAULT NULL COMMENT '下班时间设定',
  `CERTIFICATE_NO` tinyint(4) DEFAULT '0' COMMENT '证件号码',
  `CERTIFICATE_TYPE` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1 身份证 2 护照 3 驾驶证 4 其他',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `CUSTOMER_ADDR` varchar(80) NOT NULL DEFAULT '0' COMMENT '客户地址',
  `CUSTOMER_CONTACT` varchar(80) NOT NULL DEFAULT '0' COMMENT '客户联系方式',
  `CUSTOMER_EN_NAME` varchar(150) DEFAULT NULL COMMENT '客户英文名称',
  `CUSTOMER_LOGO` varchar(150) DEFAULT NULL COMMENT '企业LOGO',
  `CUSTOMER_NAME` varchar(40) NOT NULL COMMENT '客户名称',
  `CUSTOMER_STATUS` tinyint(4) NOT NULL DEFAULT '0' COMMENT '客户状态 0 新建 1 合作有效2 合作无效',
  `CUSTOMER_TYPE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '客户类型 类型为   0企业  ,    1 学校，学校的学生采用家长联系方式；企业的员工， 家人联系方式',
  `CUSTOMER_WEBSITE` varchar(80) DEFAULT NULL COMMENT '企业官网',
  `ENTERPRISE_SCALE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '1 > 10 人以下  2 > 50 人以下 3 > 100 以下 4 > 500 人以下 5 > 1000 人以下 6 > 5000 人以下  7 > 10000 人以下   8 > 50000 人以下 9 > 100000 人以下10 > 更多',
  `EXT1` varchar(200) DEFAULT NULL COMMENT '备注1',
  `EXT2` varchar(200) DEFAULT NULL COMMENT '备注2',
  `EXT3` varchar(200) DEFAULT NULL COMMENT '备注3',
  `EXT4` varchar(200) DEFAULT NULL COMMENT '备注4',
  `GOTO_WORK_TIME` datetime DEFAULT NULL COMMENT '上班时间设定',
  `IS_PER_OR_COMP` tinyint(4) NOT NULL DEFAULT '0' COMMENT '企业还是个人 0 企业，1 个人',
  `LEGAL_PERSON` varchar(30) DEFAULT NULL COMMENT '企业法人',
  `OP_USER_ID` varchar(36) DEFAULT NULL COMMENT '创建人',
  `OTHER_CONTACT` varchar(50) DEFAULT NULL COMMENT '其他联系方式',
  `POST_CODE` varchar(10) NOT NULL DEFAULT '0' COMMENT '邮编',
  `REPRE_USER` varchar(30) DEFAULT NULL COMMENT '企业代表',
  `REPRE_USER_CONTACT` varchar(50) DEFAULT NULL COMMENT '代表联系方式',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`CUSTOMER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

