/*Table structure for table `medical_report_def` */

DROP TABLE IF EXISTS `medical_report_def`;

CREATE TABLE `medical_report_def` (
  `TEMPLATE_ID` int(8) NOT NULL COMMENT '体检报告编号',
  `BELONG_TO_HISPITAL` varchar(200) DEFAULT NULL COMMENT '所属医院',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `EXT1` varchar(200) DEFAULT NULL COMMENT '备注1',
  `MEDICAL_REPORT_TYPE` int(8) NOT NULL DEFAULT '0' COMMENT '体检报告分类 : 入职体检 定期年度体检  入职体检(职业病) 离职体检(职业病) 定期年度体检(职业病)',
  `OP_USER_ID` varchar(36) DEFAULT '0' COMMENT '创建人',
  `REPORT_TYPE` tinyint(4) NOT NULL DEFAULT '1' COMMENT '报告类型 : 1 体检报告； 2 体检结果',
  `STATUS` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态 0 正常状态 1 删除状态',
  `TEMPLATE_CONTENT` varchar(500) NOT NULL COMMENT '报告描述',
  `TEMPLATE_NAME` varchar(50) NOT NULL COMMENT '报告名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间',
  `CUSTOMER_ID` int(10) NOT NULL COMMENT '客户编号',
  PRIMARY KEY (`TEMPLATE_ID`),
  KEY `FK_c8pguucpnaav6oyu14shccl4w` (`CUSTOMER_ID`),
  CONSTRAINT `FK_c8pguucpnaav6oyu14shccl4w` FOREIGN KEY (`CUSTOMER_ID`) REFERENCES `customer_info` (`CUSTOMER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

