  `ID` int(10) NOT NULL COMMENT '消息编号',
  `CREATEDATETIME` datetime DEFAULT NULL,
  `IP` varchar(100) DEFAULT NULL,
  `MESSAGE_BODY` varchar(300) DEFAULT '0' COMMENT '消息体',
  `MESSAGE_FROM` varchar(100) DEFAULT '0' COMMENT '消息来源',
  `MESSAGE_SUBJECT` varchar(200) DEFAULT '0' COMMENT '消息主题',
