  `STATUS` tinyint(4) DEFAULT '0' COMMENT '状态',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间',
  `USER_ID` varchar(36) DEFAULT '0' COMMENT '创建人',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

